import { useState } from 'react';
import './App.css';
// import About from './componsents/About';
import Navbar from './componsents/Navbar';
import TextForm from './componsents/TextForm';

function App() {
  const [mode, setMode] = useState('Dark')

  const toggleMode = () => {
    if(mode === 'light'){
      setMode('dark')
    }else{
      setMode('light')
    }
  }
  return (
    <>
    <Navbar title="TextUtils" aboutUs="About us" mode={mode} toggleMode={toggleMode}/>
    <div className="container my-3">
      {/* <About/> */}
      <TextForm title="Enter The Text Below"/>
    </div>
    </>
  );
}

export default App;
